(function() {
	const base64Images = {
        "P": "",
        "p": "",
        "R": "",
        "r": "",
        "N": "",
        "n": "",
        "B": "",
        "b": "",
        "Q": "",
        "q": "",
        "K": "",
        "k": "",
		"I": ""
    };

	// Remove old GUI if it exists
	let oldGui = document.getElementById("customGui");
	if (oldGui) oldGui.remove();

	// Create container
	let guiDiv = document.createElement("div");
	guiDiv.id = "customGui";
	guiDiv.style.position = "fixed";
	guiDiv.style.top = "0";
	guiDiv.style.right = "0";
	guiDiv.style.width = "18%";
	guiDiv.style.height = "100%";
	guiDiv.style.background = "white";
	guiDiv.style.color = "white";
	guiDiv.style.padding = "0px";
	guiDiv.style.overflowY = "auto";
	guiDiv.style.fontFamily = "Arial, sans-serif";
	guiDiv.style.zIndex = "999999";
	guiDiv.style.margin = "0";
	guiDiv.style.padding = "0";
	guiDiv.style.overflowX = "hidden";
	//guiDiv.style.boxSizing = "border-box";
	document.body.appendChild(guiDiv);

	// FIRST ROW  --------------------------------------------------------------------------------------------------
	let headerRow = document.createElement("div");
	headerRow.style.display = "flex";
	headerRow.style.alignItems = "center";
	headerRow.style.justifyContent = "flex-start";
	headerRow.style.width = "100%";
	headerRow.style.height = "7%";

	let iconImg = document.createElement("img");
	let stringIcon = base64Images['I'];
	iconImg.src = `data:image/png;base64,${stringIcon}`;
	iconImg.style.width = "20%";
	iconImg.style.height = "100%";
	iconImg.style.alignItems = "center";
	iconImg.style.justifyContent = "center";
	iconImg.style.background = "#302f2d";

	// Create title element
	let title = document.createElement("h1");
	title.innerText = "Chess Crawler";
	title.style.width="80%";
	title.style.height="100%";
	title.style.background = "#302f2d";
	title.style.display = "flex";
	title.style.alignItems = "center";
	title.style.justifyContent = "center";

	headerRow.appendChild(iconImg);
	headerRow.appendChild(title);
	guiDiv.appendChild(headerRow);

	//Second ROW ----------------------------------------------------------------------------------------------------

	let row = document.createElement("div");
	row.id = "row1"
	row.style.width = `100%`;
	row.style.height = `5%`;
	row.style.background = "#262522";
	row.style.display = "flex";
	row.style.alignItems = "center";
	row.style.justifyContent = "center";
	guiDiv.appendChild(row);

	let button1 = document.createElement("button");
	button1.id = "StartButton";
	button1.innerText = "START";
	button1.style.width = "33.33%";
	button1.style.height = "100%";
	button1.style.border = "none";
	button1.style.color = "white";
	button1.style.padding = "15px 32px";
	button1.style.display = "flex";
	button1.style.alignItems = "center";
	button1.style.justifyContent = "center";
	button1.style.textDecoration = "none";
	button1.style.background = "#262522";
	button1.style.fontSize = "16px";
	button1.style.cursor = "pointer";

	button1.addEventListener("mouseover", () => {
		button1.style.background = "#302f2d";
	});
	button1.addEventListener("mouseout", () => {
		button1.style.background = "#262522";
	});

	button1.addEventListener("mousedown", () => {
		button1.style.background = "#302f2d";
	});
	button1.addEventListener("mouseup", () => {
		button1.style.background = "#302f2d";
	});

	button1.onclick = () => {
		window.onGuiChange({
			id: button1.id,
			value: "StartClicked"
		});
	};

	row.appendChild(button1);

	for (let i = 0; i < 2; i++) {
		let label = document.createElement("label");
		let item = document.createElement("input");
		
		// Set up label styling
		label.style.display = "flex";
		label.style.width = "33.33%";
		label.style.height = "100%";
		label.style.background = "#262522";
		label.style.alignItems = "center";
		label.style.justifyContent = "center";
		
		// Set text and assign an id based on index
		if (i === 0) {
			label.appendChild(document.createTextNode("White"));
			item.id = "GuiCheckbox1";
		} else if (i === 1) {
			label.appendChild(document.createTextNode("Black"));
			item.id = "GuiCheckbox2";
		}
		
		item.type = "checkbox";
		
		// Ensure the first checkbox is checked by default
		if (i === 0) {
			item.checked = true;
		}
		
		// Add event listener for mutual exclusivity and enforcing at least one checked
		item.addEventListener("change", function() {
			if (!this.checked) {
				// If this checkbox is being unchecked, check if any other checkbox is still checked.
				let siblings = document.querySelectorAll("input[id^='GuiCheckbox']");
				let anyChecked = false;
				siblings.forEach(box => {
					if (box.checked) {
						anyChecked = true;
					}
				});
				// If none are checked, force the first checkbox ("White") to remain checked.
				if (!anyChecked) {
					document.getElementById("GuiCheckbox1").checked = true;
					window.onGuiChange({
						id: "GuiCheckbox1",
						value: true
					});
					return;
				}
			} else {
				// If this checkbox is checked, uncheck the other one.
				let siblings = document.querySelectorAll("input[id^='GuiCheckbox']");
				siblings.forEach(box => {
					if (box !== this) {
						box.checked = false;
					}
				});
			}
			// Notify the change.
			window.onGuiChange({
				id: this.id,
				value: this.checked
			});
		});
		
		label.appendChild(item);
		row.appendChild(label);
	}
	
	/// ADD The SCOREBOARD---------------------------------------------------------------------------------------------
	let contentContainer = document.createElement("div");
	contentContainer.style.display = "flex";
	contentContainer.style.width = "100%";
	contentContainer.style.height = "35%";
	contentContainer.style.alignItems = "stretch";

	let barColumn = document.createElement("div");
	barColumn.style.width = "20%"; 
	barColumn.style.height = "100%"; 
	barColumn.style.display = "flex";
	barColumn.style.alignItems = "center";
	barColumn.style.justifyContent = "center";
	barColumn.style.flexDirection = "column";
    //barColumn.style.border = "1px solid rgba(255, 255, 255, 0.5)";

	// Bar background (black by default)
	let barBackground = document.createElement("div");
	barBackground.style.width = "100%";
	barBackground.style.height = "100%"; 
	barBackground.style.background = "#403D39"; 
	barBackground.style.position = "relative";
	barBackground.style.display = "flex";
	barBackground.style.alignItems = "flex-end";

	// Bar fill (white overlay)
	let barFill = document.createElement("div");
	barFill.style.width = "100%";
	// Start at 50% fill (you can adjust as needed)
	barFill.style.height = "50%";
	barFill.style.background = "white";
	barFill.style.transition = "height 0.3s ease";

	// Append barFill inside barBackground
	barBackground.appendChild(barFill);

	// Create top text element (white text on black)
	let topText = document.createElement("div");
	topText.innerText = "0";
	topText.style.position = "absolute";
	topText.style.top = "0";
	topText.style.width = "100%";
	topText.style.textAlign = "center";
	topText.style.color = "white";
	topText.style.pointerEvents = "none"; // Allow clicks to pass through
	topText.style.display = "none"; // Visible by default

	// Create bottom text element (black text on white)
	let bottomText = document.createElement("div");
	bottomText.innerText = "0";
	bottomText.style.position = "absolute";
	bottomText.style.bottom = "0";
	bottomText.style.width = "100%";
	bottomText.style.textAlign = "center";
	bottomText.style.color = "black";
	bottomText.style.pointerEvents = "none";
	bottomText.style.display = "none"; // Hidden by default

	// Append text elements to the bar background
	barBackground.appendChild(topText);
	barBackground.appendChild(bottomText);

	// Append the bar background to the column and then the content container
	barColumn.appendChild(barBackground);
	contentContainer.appendChild(barColumn);
	document.body.appendChild(contentContainer);

	window.updateBar = function(score,mate_score) {
		let per=0;
		if(score>0)
			per = Math.log2(score+1)*23/2;
		if(score<0){
			per = Math.log2(-score+1)*23/2;
			per=-per;
		}
		per+=50;
		if(per<0)per=0;
		if(per>100)per=100;
		barFill.style.height = per + "%";
		
		if (score >= 0) {
			topText.style.display = "none";
			bottomText.style.display = "block";
			if(mate_score!="none")
				bottomText.innerText = mate_score;
			else
				bottomText.innerText = score+"";
		} else {
			topText.style.display = "block";
			bottomText.style.display = "none";
			if(mate_score!="none")
				topText.innerText = mate_score;
			else
			topText.innerText = score+"";
		}
	};
	/// ADD THE 7 ROWS----------------------------------------------------------------------------------------------------------
	let rowsContainer = document.createElement("div");
	rowsContainer.style.width = "80%";
	rowsContainer.style.height = "100%";
	rowsContainer.style.display = "flex";
	rowsContainer.style.flexDirection = "column";
	//rowsContainer.style.justifyContent = "space-between";

	/// ROW 1-----------------------------------------------------------------
	let rowDiv = document.createElement("div");
	rowDiv.style.width = "100%"; 
	rowDiv.style.height = "14%";
	rowDiv.style.background = "#302f2d";
	rowDiv.style.display = "flex";
	rowDiv.style.alignItems = "center";
	rowDiv.style.justifyContent = "center";
	rowDiv.innerText = `CONSTRAINTS`;
	rowsContainer.appendChild(rowDiv);
	/// ROW 2-3-4-----------------------------------------------------------------
	// === Create a single row for the mode checkboxes ===
	let modeRow = document.createElement("div");
	modeRow.style.display = "flex";
	modeRow.style.width = "100%";
	modeRow.style.height = "14%";
	modeRow.style.justifyContent = "space-around";
	modeRow.style.alignItems = "center";
	modeRow.style.background = "#262522";
	modeRow.style.padding = "5px";

	const modeSettings = [
	{ label: "Depth", id: "DepthCheckBox", defaultChecked: true },
	{ label: "Time", id: "TimeCheckBox", defaultChecked: false },
	{ label: "Rating", id: "SkillCheckBox", defaultChecked: false }
	];

	modeSettings.forEach((setting) => {
	let labelEl = document.createElement("label");
	labelEl.style.display = "flex";
	labelEl.style.alignItems = "center";
	labelEl.style.fontSize = "1em";
	labelEl.style.color = "#FFF";

	let textNode = document.createTextNode(setting.label + " ");
	labelEl.appendChild(textNode);

	let checkbox = document.createElement("input");
	checkbox.type = "checkbox";
	checkbox.id = setting.id;
	checkbox.checked = setting.defaultChecked;

	checkbox.addEventListener("change", function () {
		if (!this.checked) {
		let siblings = document.querySelectorAll("input[id^='TimeCheckBox'], input[id^='DepthCheckBox'], input[id^='SkillCheckBox']");
		let anyChecked = false;
		siblings.forEach((box) => {
			if (box.checked) {
			anyChecked = true;
			}
		});
		if (!anyChecked) {
			document.getElementById("TimeCheckBox").checked = true;
			window.onGuiChange({
			id: "TimeCheckBox",
			value: true
			});
			return;
		}
		} else {
		let siblings = document.querySelectorAll("input[id^='TimeCheckBox'], input[id^='DepthCheckBox'], input[id^='SkillCheckBox']");
		siblings.forEach((box) => {
			if (box !== this) {
			box.checked = false;
			}
		});
		}
		window.onGuiChange({
		id: this.id,
		value: this.checked
		});
	});

	labelEl.appendChild(checkbox);
	modeRow.appendChild(labelEl);
	});

	rowsContainer.appendChild(modeRow);

	// === Create 3 new rows for displaying PV texts ===
	for (let i = 0; i < 3; i++) {
		let pvRow = document.createElement("div");
		pvRow.style.width = "100%";
		pvRow.style.height = "40px";
		pvRow.style.display = "flex";
		pvRow.style.alignItems = "center";
		pvRow.style.justifyContent = "center";
		if(i==0 || i==2)
			pvRow.style.background = "#302f2d";
		else
			pvRow.style.background = "#262522";
		pvRow.style.color = "#FFF";
		pvRow.style.fontSize = "1em";
		
		let pvTextArea = document.createElement("textarea");
		pvTextArea.id = `PV ${i + 1}`;
		pvTextArea.style.width = "100%";
		pvTextArea.style.height = "100%";
		pvTextArea.style.background = "transparent";
		pvTextArea.style.border = "none";
		pvTextArea.style.color = "#FFF";
		pvTextArea.style.fontSize = "1em";
		pvTextArea.style.textAlign = "center";
		pvTextArea.style.verticalAlign = "middle";
		pvTextArea.style.resize = "none";
		pvTextArea.value = `PV ${i + 1}: (waiting for update)`;
		
		pvRow.appendChild(pvTextArea);
		
		rowsContainer.appendChild(pvRow);
	}

	window.updatePVS = function(pv1,pv2,pv3) {
		console.log("Updating PVs:", pv1, pv2, pv3);
		document.querySelector("#PV\\ 1").value = pv1 || "N/A";
		document.querySelector("#PV\\ 2").value = pv2 || "N/A";
		document.querySelector("#PV\\ 3").value = pv3 || "N/A";
	}

	/// ROW 5-6-7 with Color Selector and Slider -----------------------------------
	const descriptions = [
		"Depth",   // row 0
		"Time",     // row 1
		"Rating"  // row 2
	];
	
	for (let i = 0; i < 3; i++) {
		// Create the main row container
		let row = document.createElement("div");
		row.style.display = "flex";
		row.style.alignItems = "center";
		row.style.justifyContent = "space-between";
		row.style.width = "100%";
		row.style.height = "40px";
		if(i==1)
			row.style.background = "#302f2d";
		else
			row.style.background = "#262522";
		row.style.padding = "5px";
	
		let settingLabel = document.createElement("span");
		settingLabel.style.flexBasis = "25%";
		settingLabel.style.fontSize = "1em";
		let initialValue = i === 2 ? "1320" : "1";
		settingLabel.innerText = `${descriptions[i]}: ${initialValue}`;
	
		// Create the colorpicker container (20% width)
		let colorContainer = document.createElement("div");
		colorContainer.style.flexBasis = "20%";
		colorContainer.style.display = "flex";
		colorContainer.style.alignItems = "center";
		colorContainer.style.justifyContent = "center";
	
		let colorInput = document.createElement("input");
		colorInput.type = "color";
		colorInput.id = `ColorSelector${i}`;
		// Set default colors
		if (i === 0) colorInput.value = "#FF0000";
		else if (i === 1) colorInput.value = "#00FF00";
		else if (i === 2) colorInput.value = "#0000FF";
		colorInput.style.width = "90%";
		colorContainer.appendChild(colorInput);
	
		// Create the slider container (80% width)
		let sliderContainer = document.createElement("div");
		sliderContainer.style.flexBasis = "55%";
		sliderContainer.style.display = "flex";
		sliderContainer.style.alignItems = "center";
		sliderContainer.style.justifyContent = "center";
	
		let sliderInput = document.createElement("input");
		sliderInput.type = "range";
		sliderInput.id = `Slider${i}`;
		if (i === 2) {
			sliderInput.min = "1320";
			sliderInput.max = "3190";
			sliderInput.value = "1320";
		} else {
			sliderInput.min = "1";
			sliderInput.max = "20";
			sliderInput.value = "1";
		}
		sliderInput.style.width = "100%";
	
		sliderContainer.appendChild(sliderInput);
	
		row.appendChild(settingLabel);
		row.appendChild(colorContainer);
		row.appendChild(sliderContainer);
	
		rowsContainer.appendChild(row);
	
		colorInput.addEventListener("input", () => {
			window.onGuiChange({
				id: colorInput.id,
				value: colorInput.value
			});
		});
	
		sliderInput.addEventListener("input", () => {
			settingLabel.innerText = `${descriptions[i]}: ${sliderInput.value}`;
			window.onGuiChange({
				id: sliderInput.id,
				value: sliderInput.value
			});
		});
	}
	// ----------------------------------------------------------------------------------------------------------------------
	contentContainer.appendChild(barColumn);
	contentContainer.appendChild(rowsContainer);
	guiDiv.appendChild(contentContainer);

	// FEN Display ----------------------------------------------------------------------------------------------------------
	let fenDisplay = document.createElement("div");
	fenDisplay.style.width = "100%"; 
	fenDisplay.style.height = "5%";
	fenDisplay.style.background = "#302f2d";
	fenDisplay.style.display = "";
	fenDisplay.style.alignItems = "center";
	fenDisplay.style.justifyContent = "center";

	let FENTextArea = document.createElement("textarea");
	FENTextArea.style.width = "100%";
	FENTextArea.style.height = "100%";
	FENTextArea.style.background = "transparent";
	FENTextArea.style.border = "none";
	FENTextArea.style.outline = "none";
	FENTextArea.style.color = "#FFF";
	FENTextArea.style.textAlign = "center";
	FENTextArea.style.verticalAlign = "middle";
	FENTextArea.style.resize = "none";
	FENTextArea.id = "fenDisplay";
	FENTextArea.value = "FEN: (waiting for update)";

	fenDisplay.appendChild(FENTextArea);
	guiDiv.appendChild(fenDisplay);
	

    // Chessboard container --------------------------------------------------------------------------------------------------
    let chessboardDiv = document.createElement("div");
	chessboardDiv.id = "chessboard";
	chessboardDiv.style.display = "grid";
	chessboardDiv.style.gridTemplateColumns = "repeat(8, 12.49%)";

	chessboardDiv.style.width = "100%"; 

	chessboardDiv.style.position = "relative";
	guiDiv.appendChild(chessboardDiv);

	for (let i = 0; i < 64; i++) {
		let square = document.createElement("div");
		square.style.width = "100%";
		square.style.paddingBottom = "100%"; 
		square.style.position = "relative";
		square.style.display = "flex";
		square.style.justifyContent = "center";
		square.style.alignItems = "center";
		
		let row = Math.floor(i / 8);
		let col = i % 8;
		
		if (row % 2 === 0) {
			square.style.backgroundColor = (col % 2 === 0) ? "#f0d9b5" : "#b58863";
		} else {
			square.style.backgroundColor = (col % 2 === 0) ? "#b58863" : "#f0d9b5";
		}
		
		square.id = "square" + i;
		chessboardDiv.appendChild(square);
	}

	window.updateChessboardFromMatrix = function(matrix) {
		for (let i = 0; i < 8; i++) {
			for (let j = 0; j < 8; j++) {
				let square = document.getElementById("square" + (i * 8 + j));

				square.innerHTML = "";
				let piece = matrix[i][j];
				if (piece === ".") continue;
				let base64String = base64Images[piece];
				if (!base64String) continue;
				let img = document.createElement("img");

				img.src = `data:image/png;base64,${base64String}`;

				img.style.position = "absolute";
				img.style.top = "0";
				img.style.left = "0";
				img.style.width = "100%";
				img.style.height = "100%";
				square.appendChild(img);
			}
		}
	}
	/// TOTAL SETTINGS-----------------------------------------------------------------------------------------------------------------------------------------------------------------
	for (let i = 0; i < 3; i++) {
		let label1 = document.createElement("label");
		let item1 = document.createElement("input");
		
		label1.style.display = "flex";
		label1.style.width = "100%";
		label1.style.height = "3.9%";
		if(i==0 || i==2)
			label1.style.background = "#262522";
		else
			label1.style.background = "#302f2d";
		label1.style.alignItems = "center";
		label1.style.justifyContent = "center";
		
		if (i === 2) {
			label1.appendChild(document.createTextNode("NoBlunder Settings"));
			item1.id = "NoBlunder";
		} else if (i === 1) {
			label1.appendChild(document.createTextNode("Teacher Settings"));
			item1.id = "Teacher";
		} else if (i === 0) {
			label1.appendChild(document.createTextNode("Engine Settings"));
			item1.id = "Engine";
		}
		
		item1.type = "checkbox";
		item1.classList.add("settingsCheckbox");
	
		if (i === 0) {
			item1.checked = true;
		}
		
		item1.addEventListener("change", function() {
			if (!this.checked) {
				let siblings = document.querySelectorAll('.settingsCheckbox');
				let anyChecked = false;
				siblings.forEach(box => {
					if (box.checked) {
						anyChecked = true;
					}
				});
				if (!anyChecked) {
					document.getElementById("NoBlunder").checked = true;
					window.onGuiChange({
						id: "NoBlunder",
						value: true
					});
					return;
				}
			} else {
				let siblings = document.querySelectorAll('.settingsCheckbox');
				siblings.forEach(box => {
					if (box !== this) {
						box.checked = false;
					}
				});
			}
			window.onGuiChange({
				id: this.id,
				value: this.checked
			});
		});
		
		label1.appendChild(item1);
		guiDiv.appendChild(label1);
	}
})();
